import React from "react";

const ItemCard = (props) => {

  const storage = props.storage;

  const setStore = storage.map((item) => {
    return (
      <div className="card" style={{ maxWidth: "50vw" }}>
        <img src="..." className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title">{item.name}</h5>
          <p className="card-text">{item.phone}</p>
        </div>
        <ul className="list-group list-group-flush">
          <li className="list-group-item">{item.address.street}</li>
          <li className="list-group-item">{item.address.suite}</li>
          <li className="list-group-item">{item.address.city}</li>
        </ul>
        <div className="card-body">
          <a href="https://`${item.website}`" className="card-link">{item.website}</a>
          <a href="#" className="card-link">{item.company.name}</a>
        </div>
      </div>
    )
  })


  return(
    <div>
      {setStore}
      <p>Mother Fucker!!!!</p>
    </div>
  )
}

export default ItemCard;
